import React, { useState } from 'react';
import './styles/create.css'; // Подключаем CSS файл

const Create = () => {
  const [formData, setFormData] = useState({
    title: '',
    category: '',
    number: '',
    city: '',
    description: '',
    photo: null,
  });

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData({
      ...formData,
      [name]: value,
    });
  };

  const handleFileChange = (e) => {
    setFormData({
      ...formData,
      photo: e.target.files[0],
    });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    const form = new FormData();
    for (const key in formData) {
      form.append(key, formData[key]);
    }
    form.append('user_id', 1); // Здесь можно подставить ID текущего пользователя

    try {
      const response = await fetch('http://localhost:8000/create_ad', {
        method: 'POST',
        body: form,
      });

      if (response.ok) {
        alert('Объявление успешно создано!');
      } else {
        alert('Ошибка при создании объявления.');
      }
    } catch (error) {
      console.error('Ошибка:', error);
      alert('Ошибка при создании объявления.');
    }
  };

  return (
    <form className="create-message" onSubmit={handleSubmit}>
      <div className="form-left">
        <div className="form-group">
          <div className="image-upload">
            <label htmlFor="photo">
              <div className="upload-box">
                <span className="upload-icon">+</span>
              </div>
            </label>
            <input type="file" id="photo" name="photo" accept="image/*" style={{ display: 'none' }} onChange={handleFileChange} />
          </div>
        </div>
      </div>

      <div className="form-right">
        <div className="form-group">
          <label htmlFor="title">Название:</label>
          <input type="text" id="title" name="title" size="30" value={formData.title} onChange={handleChange} />
        </div>

        <div className="form-group">
          <label htmlFor="category">Категория:</label>
          <select id="category" name="category" value={formData.category} onChange={handleChange}>
            <option value="test1">Тест1</option>
            <option value="test2">Тест2</option>
            <option value="test3">Тест3</option>
          </select>
        </div>

        <div className="form-group">
          <label htmlFor="number">Число:</label>
          <input type="number" id="number" name="number" value={formData.number} onChange={handleChange} />
        </div>

        <div className="form-group">
          <label htmlFor="city">Город:</label>
          <select id="city" name="city" value={formData.city} onChange={handleChange}>
            <option value="test1">Тест1</option>
            <option value="test2">Тест2</option>
            <option value="test3">Тест3</option>
          </select>
        </div>

        <div className="form-group">
          <label htmlFor="description">Описание:</label>
          <textarea id="description" name="description" rows="10" cols="50" value={formData.description} onChange={handleChange}></textarea>
        </div>

        <input type="submit" value="Опубликовать" />
      </div>
    </form>
  );
};

export default Create;
